@import "tailwindcss";

@theme {
  ----default-font-family: Inter, sans-serif;
}

/* Comentando configura√ß√µes de tema escuro para usar o tema claro do app.tsx
html {
  color-scheme: dark;
}

body {
  margin: 0;
  min-height: 100vh;
  background-color: rgb(9 9 11);
}
